import React, { Component } from 'react';
import './Header.css';

class Header extends Component {
  render() {
    return (
      <div className="header-options">
        <div className="menu-buttons">
          <nav>
            <h3>Logo</h3>
            <ul>
              <li>Recipes</li>
              <li>Home</li>
            </ul>
          </nav>
        </div>
      </div>
    );
  }
}

export default Header;
